package no.entur.abt.android.token.core.exception;

public class DeviceAttestationInvalidFormatException extends DeviceAttestationException {

	public DeviceAttestationInvalidFormatException(String message) {
		super(message);
	}

	public DeviceAttestationInvalidFormatException(String message, Throwable cause) {
		super(message, cause);
	}
}
